import Banner from "../../src/images/Banner.png";

const NavBar = () => {

    return (
        <header>
            <nav className="navbar navbar-custom">
                <a href="https://minted.ist" style={{float: 'left'}}><img src={Banner} /></a>
            </nav>
        </header>
    )
}

export default NavBar
